import React from 'react';
import { Navbar } from 'react-bootstrap';

const Customer = () => {
    return (
        <div>
            <Navbar style={{height:"4rem"}} className="bg-light"></Navbar>
            <div className="row">
                <div className="col-md-3 bg-light align-middle ml-3" style={{height:"100vh"}}>
                    <button style={{border:"none", background:"none"}}>Order</button> <br/>
                    <button style={{border:"none", background:"none"}}>Service lits</button> <br/>
                    <button style={{border:"none", background:"none"}}>Review</button> <br/>
                </div>
                    <div className="col-md-9 bg-smoke-white">
                        
                    </div>
                </div>
        </div>
        
    );
};

export default Customer;
